import "./header.css";

export default function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitleSm">Welcome to My site</span>

      </div>
      <img
        className="headerImg"
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.arkinfo.in%2Fblogs%2Ftechnology%2FTechnology-M-E-and-many-things-possible&psig=AOvVaw1skcRndxPJhp2L3kUQX04C&ust=1651210320136000&source=images&cd=vfe&ved=0CAkQjRxqFwoTCLDr7_mDtvcCFQAAAAAdAAAAABAN"
        alt="Loading: Please wait for Image"
      />
    </div>
  );
}
